var filegroup_tbl=$("#filegroup_tbl").DataTable({pageLength:10,responsive:true,sAjaxDataProp:"",aoColumns:[{mData:"name"},{mData:"creationTime"},{mData:function(a){return{id:a.id}}},{mData:function(a){return{id:a.id}}}],columnDefs:[{render:function(a){return moment(a).format("MMM DD, YYYY hh:mm:ss A")},width:"10%",targets:1},{render:function(b){var a=filegroup_url+"/"+b.id;return'<a class="btn btn-xs btn-success"  href="'+a+'" data-placement="top" data-toggle="tooltip" title="View Details"><span class="fa fa-info-circle"></span></a>'},orderable:false,bSearchable:false,width:"0",className:"text-center",targets:2},{render:function(a){return'<button class="btn btn-danger btn-xs delete" data-placement="top" title="Delete File"><span class="glyphicon glyphicon-trash"></span></button>'},orderable:false,bSearchable:false,width:"0",className:"text-center",targets:3}],order:[[1,"desc"]]});$("#filegroup_tbl tbody").on("click","tr td .delete",function(){var c=$(this).parents("tr")[0];var b=filegroup_tbl.row(c);var a=b.data();$("#delete_file_name").text(a.name);$("#del_btn").data("id",b.index());$("#confirm_delete").modal("toggle")});$(document).on("click","#del_btn",function(b){var d=$("#del_btn").data("id");var c=filegroup_tbl.row(d);var a=c.data();$.ajax({url:ws_filegroup_url+"/"+a.id,type:"DELETE",success:function(){c.remove().draw()}})});$("body").tooltip({selector:'[data-toggle="tooltip"]'});$(document).ready(function(){$.ajax({url:encodeURI(ws_filegroup_url),dataType:"json",type:"GET",success:function(a){filegroup_tbl.clear();filegroup_tbl.rows.add(a);filegroup_tbl.draw()},error:function(a,c,b){alert("Unable to fetch dataset.")}})});